import { Home, Activity } from 'react-feather'
export default [
  {
    id: 'home',
    title: 'Home',
    icon: <Home />,
    children: [
      {
        id: 'eCommerceDash',
        title: 'Network',
        icon: <Activity />,
        navLink: '/dashboard/ecommerce'
      },
      {
        id: 'analyticsDash',
        title: 'Development',
        icon: <Activity />,
        navLink: '/dashboard/analytics'
      }
    ]
  }
]
